// SPDX-License-Identifier: MIT
pragma solidity ^0.8.19;

contract Healthcare {
    enum WasteStatus { Created, Collected, InTransit, Processed }
    
    struct WasteRecord {
        uint id;
        string details;
        WasteStatus status;
        address createdBy;
    }

    mapping(uint => WasteRecord) private wasteRecords;
    uint private wasteCount;

    event WasteCreated(uint indexed id, string details, address indexed createdBy);
    event WasteStatusUpdated(uint indexed id, WasteStatus status);

    function createWasteRecord(string memory _details) public {
        require(bytes(_details).length > 0, "Details must not be empty");
        wasteCount++;
        wasteRecords[wasteCount] = WasteRecord(wasteCount, _details, WasteStatus.Created, msg.sender);
        emit WasteCreated(wasteCount, _details, msg.sender);
    }

    function updateWasteStatus(uint _id, WasteStatus _status) public {
        require(_id > 0 && _id <= wasteCount, "Invalid waste ID");
        WasteRecord storage waste = wasteRecords[_id];
        require(msg.sender == waste.createdBy, "Only the creator can update status");
        waste.status = _status;
        emit WasteStatusUpdated(_id, _status);
    }

    function getWasteRecord(uint _id) public view returns (uint, string memory, WasteStatus, address) {
        require(_id > 0 && _id <= wasteCount, "Invalid waste ID");
        WasteRecord memory waste = wasteRecords[_id];
        return (waste.id, waste.details, waste.status, waste.createdBy);
    }

    function getWasteCount() public view returns (uint) {
        return wasteCount;
    }
}

